import React from "react";

export default function Header({forlabel, inputlabel, inputtype}) {
  return (
    <>
      <div class="mb-3 row mx-3">
        <label for="email" class="col-sm-2 col-form-label">
            {forlabel}
        </label>
        <div class="col-sm-10">
          <input
            type= {inputtype}
            readonly
            class="form-control-plaintext"
            id="staticEmail"
            value="email@example.com"
          />
        </div>
      </div>
    </>
  );
}
